import Axios from 'axios'


class Dashboard extends Component {

    constructor(){
        
        super()

        this.state = {
            test: "testStat"
        }
    }

    render() {
        if (1 == 1) {
            return (
                <Router>
                    <Switch>
                        <Route path="/">
                            home
                        </Route>
                        <Route path="/teacher">
                            teacher
